                                $categoriesList = $grouped->map(function ($group) {
                                    $first = $group->first();
                                    $category = $first['category'] ?? [];
                                    $name = $category['name_en'] ?? $category['name_ar'] ?? 'Category';
                                    $categoryId = $category['id'] ?? null;
                                    $icon = $category['icon'] ?? null;
