                                    // Check if any service in this category is active
                                    $hasActiveService = collect($group)->contains(function ($s) {
                                        return ($s['is_active'] ?? false) === true || ($s['is_active'] ?? null) === 1;
                                    });

                                    // Count services in this category
                                    $serviceCount = $group->count();

                                    return [
                                        'id' => $categoryId,
                                        'name' => $name,
                                        'enabled' => $hasActiveService,
                                        'service_count' => $serviceCount,
                                        'icon' => $icon,
                                        'color' => $color
                                    ];
                                })->values()->all();
                            } catch (\Throwable $e) {
                                $categoriesList = [];
                            }
                        }
