// Service Delete Function
function deleteService(serviceId) {
    if (!confirm('{{ __('providers.delete_service_confirm') }}')) {
        return;
    }

    const csrfToken = document.querySelector('meta[name="csrf-token"]').content;

    fetch(`/services/${serviceId}`, {
        method: 'DELETE',
        headers: {
            'X-CSRF-TOKEN': csrfToken,
            'Accept': 'application/json',
            'Content-Type': 'application/json'
        }
    })
    .then(response => response.json())
    .then(data => {
        if (data.success) {
            if (window.Swal) {
                Swal.fire({
                    icon: 'success',
                    title: '{{ __('providers.deleted') }}',
                    text: data.message || '{{ __('providers.service_deleted') }}',
                    timer: 2000,
                    showConfirmButton: false
                }).then(() => {
                    window.location.reload();
                });
            } else {
                alert(data.message || 'Service deleted successfully');
                window.location.reload();
            }
        } else {
            if (window.Swal) {
                Swal.fire('{{ __('providers.error') }}', data.message || '{{ __('providers.failed_delete_service') }}', 'error');
            } else {
                alert(data.message || '{{ __('providers.failed_delete_service') }}');
            }
        }
    })
    .catch(error => {
        console.error('Error:', error);
        if (window.Swal) {
            Swal.fire('{{ __('providers.error') }}', '{{ __('providers.failed_delete_service') }}', 'error');
        } else {
            alert('{{ __('providers.failed_delete_service') }}');
        }
    });
}

// Service Search Functionality
document.getElementById('serviceSearch')?.addEventListener('input', function(e) {
    const searchTerm = e.target.value.toLowerCase();
    const rows = document.querySelectorAll('table tbody tr');

    rows.forEach(row => {
        const serviceName = row.querySelector('td:nth-child(2)')?.textContent.toLowerCase() || '';
        const category = row.querySelector('td:nth-child(3)')?.textContent.toLowerCase() || '';

        if (serviceName.includes(searchTerm) || category.includes(searchTerm)) {
            row.style.display = '';
        } else {
            row.style.display = 'none';
        }
    });
});

// Status Filter Functionality
document.querySelectorAll('.filter-status').forEach(filter => {
    filter.addEventListener('click', function(e) {
        e.preventDefault();
        const status = this.dataset.status;
        const rows = document.querySelectorAll('table tbody tr');

        rows.forEach(row => {
            const statusBadge = row.querySelector('td:nth-child(4) .badge');
            if (!statusBadge) return;

            const isActive = statusBadge.textContent.trim().toLowerCase().includes('enable');

            if (status === 'all') {
                row.style.display = '';
            } else if (status === 'active' && isActive) {
                row.style.display = '';
            } else if (status === 'inactive' && !isActive) {
                row.style.display = '';
            } else {
                row.style.display = 'none';
            }
        });
    });
});

// Payment Settings Form Handler
document.getElementById('paymentSettingsForm').addEventListener('submit', function(e) {
    e.preventDefault();
    
    const formData = new FormData(this);
    const data = {
        provider_id: formData.get('provider_id'),
        commission: parseFloat(formData.get('commission')),
        tax: parseFloat(formData.get('tax')),
        currency: formData.get('currency')
    };
    
    // Show loading state
    const submitBtn = this.querySelector('button[type="submit"]');
    const originalText = submitBtn.innerHTML;
    submitBtn.disabled = true;
    submitBtn.innerHTML = '<span class="spinner-border spinner-border-sm me-1"></span> {{ __('providers.saving') }}';
    
    fetch('{{ route("payments.updateProviderSettings") }}', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
            'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').content
        },
        body: JSON.stringify(data)
    })
    .then(response => response.json())
    .then(result => {
        submitBtn.disabled = false;
        submitBtn.innerHTML = originalText;
        
        if (result.success) {
            Swal.fire({
                icon: 'success',
                title: '{{ __('providers.success') }}',
                text: result.message,
                timer: 2000,
                showConfirmButton: false
            }).then(() => {
                location.reload();
            });
        } else {
            Swal.fire({
                icon: 'error',
                title: '{{ __('providers.error') }}',
                text: result.message || '{{ __('providers.failed_update_settings') }}'
            });
        }
    })
    .catch(error => {
        console.error('Error:', error);
        submitBtn.disabled = false;
        submitBtn.innerHTML = originalText;
        Swal.fire({
            icon: 'error',
            title: '{{ __('providers.error') }}',
            text: '{{ __('providers.update_settings_error') }}'
        });
    });
});

// Update calculation example when commission rate changes
document.getElementById('commission_rate').addEventListener('input', function() {
    const rate = parseFloat(this.value) || 0;
    const serviceAmount = 100;
    const commissionAmount = serviceAmount * (rate / 100);
    const providerAmount = serviceAmount - commissionAmount;
    
    document.getElementById('example_commission_rate').textContent = rate.toFixed(1);
    document.getElementById('example_commission_amount').textContent = commissionAmount.toFixed(2);
    document.getElementById('example_provider_amount').textContent = providerAmount.toFixed(2);
});

// Image Viewer Function
function viewImage(imageUrl, imageName) {
    document.getElementById('imageViewerImg').src = imageUrl;
    document.getElementById('imageViewerTitle').textContent = imageName;
    const imageModal = new bootstrap.Modal(document.getElementById('imageViewerModal'));
    imageModal.show();
}
</script>
